import React, { Component } from 'react'
import Navbar from "../components/Navbar"
import Container from "../components/Container"
import EmailForm from "../components/Email"
import Footer from "../components/Footer"
import HomeContainer from '../components/HomeContainer'

const components = {
    "Home": <HomeContainer />,
    "Email": <EmailForm />,
    "Machine": <Container/>
}

class Home extends Component {
    constructor(props) {
        super(props)
        this.state = {
            email: false,
            whichComponentToShow: 'Home'
        }
    }

    showComponent=(componentName)=> {
        this.setState({whichComponentToShow: componentName});
      }



    render() {
        return (
            <div>
                <Navbar changeComponent={this.showComponent} whatToshow={this.state.whichComponentToShow} emailForm={this.emailForm} homeContents={this.homeContents}>
                </Navbar >
                <div>
                    {components[this.state.whichComponentToShow]}
                </div>
                {/* <Footer>
                </Footer> */}
            </div>
        )
    }
}
export default Home;
